function lineStringLength(t,e,r,i){let g=t[e],h=t[e+1],l=0;for(let n=e+i;n<r;n+=i){var a=t[n],L=t[n+1];l+=Math.sqrt((a-g)*(a-g)+(L-h)*(L-h)),g=a,h=L}return l}function linearRingLength(n,t,e,r){var i=lineStringLength(n,t,e,r),g=n[e-r]-n[t],e=n[e-r+1]-n[t+1];return i+=Math.sqrt(g*g+e*e)}export{lineStringLength,linearRingLength};